import React from "react";
import "../footer/Footer.css";
import support3 from "../images/support3.svg";
const Footer = () => {
  return (
    <div className="footerMain">
      <div className="row container fotterUpper">
        <div className="col-md-6 ">
          <p>
            If you could not find the information you were looking for,
            <br></br>call or contact us
          </p>
        </div>
        <div className="col-md-6">
          <div className="row justify-content-center lowwerPhone">
            <img
              src={support3}
              className="iconImage"
              style={{ color: "white" }}
            />
            <p
              className="phone"
              style={{ paddingLeft: "1rem", paddingTop: "0.5rem" }}
            >
              (90)777 77 07
            </p>
          </div>
        </div>
      </div>
      <div className="lastFooter">
        <div className="row">
          <div className="col-sm-12 col-md-12 col-lg-4 lastp">colm 1</div>
          <div className="col-sm-12 col-md-12 col-lg-4">colm 2</div>
          <div className="col-sm-12 col-md-12 col-lg-4">colm 3</div>
        </div>
      </div>
    </div>
  );
};

export default Footer;
